import React from 'react';
import ReactDOM from 'react-dom';
import Grid from '@material-ui/core/Grid';
import Button from '@material-ui/core/Button';
import FormControl from '@material-ui/core/FormControl'
import Input from '@material-ui/core/Input'

class Main extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      gameState: {
        players:['Chris',  'Arjun', 'Noah'],
      },
    }
  }

  handleName = (e) => {
    this.setState({
      name: e.target.value
    })
  }
  render() {
    const playerArr = this.state.gameState.players.map((doc, i) => (
      <div key={doc._id}>
      <DocumentViewBtn handleDeletePassword={(e)=> this.handleDeletePassword(e)} handleDelete={(e, id, i) => this.handleDelete(e, id, i)} index={i} toggleEdit={(e, id) => this.toggleEdit(e, id)} title={doc.title} listId={doc._id} documentsList={this.state.documents}/>
      </div>
    ));

    return (
      <div>
      <h1> Main!!! </h1>
      </div>
    );
  }
}

export default Main
